(20, 'Список ссылок для обучению подбору дисков', 'http://altezza-club.ru/forum/index.php?showtopic=28580&hl=+%D0%B2%D0%BE%D0%BF%D1%80%D0%BE%D1%81%D1%8B%20+%D0%B2%D1%8B%D0%BB%D0%B5%D1%82%D0%BE%D0%BC&page=1\r\n\r\nhttp://www.1010tires.com/Tools/Wheel-Offset-Calculator#\r\n\r\nhttp://www.willtheyfit.com/\r\n\r\nhttps://www.customwheeloffset.com/', 0, 'managerActions', 500),
(21, 'ДЛЯ ВИТАЛИ ', 'OVERALL CATEGORIES (OC)\r\nD drom\r\nA avito\r\nS site\r\nR regional site\r\nI drive 2\r\nV vk\r\nF forums\r\n\r\nНаправления ввода (IC - INPUT CATEGORIES)\r\nDT1 drom type 1\r\nDT2 drom type 2\r\nDF1 drom filial 1\r\nDF2 drom filial 2\r\nDR1 drom region 1\r\nDR2 drom region 2\r\nAT avito tomsk\r\nAF avito filial\r\nAR avito region\r\n\r\nPersons (PERS):\r\nAA \r\nVJ\r\nSK\r\nKK\r\nMK\r\n\r\nRoles (ROLE):\r\nKLF kladovshik filiala\r\nOPT operator\r\nPRT partner\r\nPSR posrednik\r\n\r\nGOOD LOCATION AND TYPES (GLT)\r\nNTS НАШИ ТОВАРЫ НА ОСНОВНОМ СКЛАДЕ\r\nNTF НАШИ ТОВАРЫ НА СТОРОННИХ СКЛАДАХ\r\nNTP ПРОДАЖА НАШИХ ТОВАРОВ В БАЗАХ ПОСРЕДНИКОВ\r\nPTS ЧУЖИЕ ТОВАРЫ НА ОСНОВНОМ СКЛАДЕ\r\nPTI ПАРТНЕРСКИЕ ТОВАРЫ ИЗ ИНТЕРНЕТА И ОТ ПАРТНЕРОВ\r\nJAP ТОВАРЫ ИЗ ЯПОНИИ И В ПУТИ\r\n\r\nтипы ввода (INPUT TYPE IT являются атрибутом для каждого IC)\r\nTABLE (CONST FROM TABLE)\r\nBASE (OBJECT, PHOTO ETC FROM PLATFORM)\r\nX (FIXED TEXT FOR ALL ID''S)\r\nXVAR (FROM LIST OF FIXED TEXTS. LIST IS USED FOR ALL ID''S)\r\nXFIX (FIXED TEXT FOR CURRENT ID OR FOR LIST OF ID''S)\r\nOMIT (OPT MANUAL INPUT TEXT)\r\nPARS (GET VALUE)\r\nINTPR (INTERPRETATOR)\r\n\r\nЭЛЕМЕНТЫ ОБЪЯВЛЕНИЯ (ADVERT ATTRIBUTES (ADVATT))\r\nA1 ПАРАМЕТРЫ\r\nА2 ФОТО\r\nА3 ХЕДЕР\r\nА4 ФУТЕР\r\nА5 ГАРАНТИЯ\r\nА6 ДОСТАВКА\r\nА7 ЦЕНА\r\nА8 ОПИСАНИЕ\r\n\r\nВ ИТОГЕ МЫ ДОЛЖНЫ СОСТАВИТЬ КУБ ИЗ ТРЕХ ОСЕЙ GLT, IC, ADVATT ТЕЛО КОТОРОГО БУДУТ ЗАПОЛНЯТЬ ЦЕПОЧКИ ИЗ АТРИБУТОВ IT, ROLE/PERS, \r\n\r\nEXAMPLE: IC=DT1 (ПРИМЕР ТАБЛИЦЫ ДЛЯ НАПРАВЛЕНИЯ ВВОДА ДРОМ РУ ТИП ОБЪЯВЛЕНИЙ 1. В ДАННОЙ ТАБЛИЦЕ УКАЗАН НЕОБХОДИМЫЙ ПЕРЕЧЕНЬ ЗНАЧЕНИЙ ИНФОРМАЦИИ НЕОБХОДИМЫЙ ДЛЯ РАЗМЕЩЕНИЯ ОБЪЯВЛЕНИЙ ПО 5 ТИПАМ ТОВАРОВ GLT)\r\n\r\nNTS A1=TABLE*SK A2=BASE*SK A3=XVAR(Y)*AA A4=X*AA A5=XVAR(Y)*AA A6=XVAR(Z)*AA A7=TABLE*AA A8=TABLE*AA+TABLE*SK\r\n\r\nРАЗБЕРЕМ ЭТУ СТРОКУ: ДЛЯ ЗАПОЛНЕНИЯ ОБЪЯВЛЕНИЯ НА ДРОМЕ (ТИП1) ПО НАПРАВЛЕНИЮ ПРОДАЖ "НАШИ ТОВАРЫ НА ОСНОВНОМ СКЛАДЕ" НЕОБХОДИМЫ СЛЕДУЮЩИЕ ПАРАМЕТРЫ: \r\nА1 (ПАРАМЕТРЫ ТОВАРА), КОТОРЫЕ БЕРУТСЯ ИЗ ТАБЛИЦЫ, ЗА КОТОРУЮ ОТВЕТСТВЕННЕН СЕРГЕЙ КОСИНОВ, \r\nА2 (ФОТО), КОТОРЫЕ БЕРУТСЯ ИЗ БАЗЫ, ЗА КОТОРУЮ ОТВЕТСТВЕННЕН СЕРГЕЙ КОСИНОВ, \r\nА3 (ХЕДЕР) - ВЫБИРАЕТСЯ ИЗ СПИСКА ВОЗМОЖНЫХ ХЕДЕРОВ (ОБЩИЙ СПИСОК ДЛЯ ВСЕХ АЙДИ) ПО КАКОМУ-ТО ПАРАМЕТРУ "Y" (ДАННЫЙ ПАРАМЕТР В ЭТОМ ПРИМЕРЕ НЕ ПРОПИСАН, БУДЕТ РЕАЛИЗОВАН ПОЗЖЕ), ЗА КОТ. ОТВ-Н АНДРЕЙ РАЗУМОВ, \r\nA4 (ФУТЕР) - ФИКСИРОВАННЫЙ ТЕКСТ ДЛЯ ВСЕХ АЙДИ (ВНУТРИ КАТЕГОРИИ DT1!!!!!), ЗА КОТ ОТВ РАЗУМОВ\r\nA5 (ГАРАНТИЯ) - ВЫБИРАЕТСЯ ИЗ СПИСКА ВОЗМОЖНЫХ ГАРАНТИЙ (ОБЩИЙ СПИСОК ДЛЯ ВСЕХ АЙДИ) ПО КАКОМУ-ТО ПАРАМЕТРУ "Y" (ДАННЫЙ ПАРАМЕТР В ЭТОМ ПРИМЕРЕ НЕ ПРОПИСАН, БУДЕТ РЕАЛИЗОВАН ПОЗЖЕ), ЗА КОТ. ОТВ-Н АНДРЕЙ РАЗУМОВ. ОБРАТИ ВНИМАНИЕ! УКАЗАН ТОТ ЖЕ ПАРАМЕТР "Y" ТО ЕСТЬ А3 И А5 БУДУТ ЗАВИСЕТЬ ОТ ОДНОГО И ТОГО ЖЕ ПАРАМЕТРА\r\nА6 (ДОСТАВКА) ТО ЖЕ САМОЕ ЧТО А5, НО ПО ДРУГОМУ ПАРАМЕТРУ Z!!\r\nA7 ТАБЛИЦА ЗА КОТ ОТВ АА\r\nА8 СУММА ДВУХ ТЕКСТОВЫХ ЗНАЧЕНИЙ (СЛИЯНИЕ ТЕКСТА ИЗ ТАБЛ ЗКО АА И ДРУГОЙ ТАБЛ ЗКО СК)\r\n\r\n\r\nPTS A1=TABLE*SK A2=BASE*SK A3=XVAR(Y)*AA A4=X*AA A5=XVAR(Y)*AA A6=XVAR(Z)*AA A7=TABLE*(AA+PRT) A8=TABLE*AA+TABLE*SK+TABLE PRT\r\n\r\nPTI A1=TABLE*PRT OR PARS*VJ A2=BASE*PRT OR PARS VJ A3=XVAR(Y)*AA/PRT A4=X*AA/PRT A5=XVAR(Y)*AA/PRT A6=XVAR(Z)*AA/PRT A7=TABLE*(AA+PRT) A8=TABLE*AA+TABLE PRT\r\n\r\nNTF TABLE*KLF/VJ A2=BASE*KLF/VJ A3=XVAR(Y)*AA A4=X*AA A5=XVAR(Y)*AA A6=XVAR(Z)*AA A7=TABLE*(AA) A8=TABLE*AA+TABLE*KLF\r\n\r\nJAP TABLE*OPT+AA A2=BASE*VJ A3=XVAR(Y)*AA A4=X*AA A5=XVAR(Y)*AA A6=XVAR(Z)*AA A7=TABLE*(AA) A8=TABLE*AA+TABLE*OPT\r\n\r\nNTP A1=TABLE*SK/KLF/AA A2=BASE*SK/VJ A3=XVAR(Y)/TABLE*AA/PSR A4=X/XVAR/TABLE*AA/PSR A5=XVAR(Y)/TABLE*AA/PSR A6=XVAR(Z)*AA/PSR A7=TABLE*AA/VJ/PSR A8=TABLE*AA/PSR+TABLE*SK/VJ\r\n\r\nСоздать куб для выбора GLT\r\nКуб IC\r\nТаблицу "O"шек\r\nАлгоритм выбора города\r\nАтрибут товара "Область выкладки"\r\n', 0, 'managerActions', 1000),
