INSERT INTO `vars` (`name`, `value`) VALUES
('dlvr_0', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('dlvr_1', '`([+ATTR=36+]==1||[+ATTR=36+]==2)?("Наличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией. Доставка до склада тк ПЭК в нашем городе включена в цену (для дисков включена упаковка в картон).\r\nОтправка другими тк обсуждается индивидуально. \r\n"):("Самовывоз, г. [+ATTR=27+]\r\nНаличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией.\r\nСтоимость доставки до тк и оформления документов на отправку [+LIST=50+]р. за 2 или 4 шины. \r\nСтоимость упаковки дисков в картон, доставки до тк и оформления документов [+LIST=51+]р. за 4 диска.\r\n\r\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \r\n1. Выбираете тк\r\n2. Вводите название тк в гугл\r\n3. Переходите на сайте в раздел \\"калькулятор\\". \r\nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\r\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\r\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.")`'),
('DOSD_Барнаул_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. \r\nПри бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней.\r\n\r\nналичными, карта сбер, альфабанк'),
('DOSD_Белгород_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Владивосток_3659593', '`("[+ATTR=27+]"!="Владивосток")?("наличные, указана конечная цена с доставкой на наш склад в г. [+ATTR=27+]. "):("наличные, могу отправить в любой город транспортной компанией.")`'),
('DOSD_Владивосток_wheels70', 'Адрес самовывоза уточняйте по телефону!  Могу отправить в любой город Транспортными компаниями.  Способы оплаты: наличными, карта сбербанк, альфабанк'),
